import React, { Component } from "react";

import "./App.css";
import "./Project.css";
import Image from "./Image.js";
import Project from "./Project.js"


function ProjectList(props){
  let projects = props.projectState.map((card) => {
    return <Card key={card.key} name={card.name} backImage={card.backImage} readOrNot={card.readOrNot} chooser={card.chooser} />

  })
  return (
      <div className="ProjectList">
      {projects}
      </div>
  )

}

export default ProjectList;
